Kids Behind Bars

Sociopolitical Documentary hosted by David Morrissey, published by ITV in 2014 - English narration


Information
------------------------------

Kids Behind Bars
Documentary meeting some of America's most dangerous young offenders. The Wabash Valley Correctional Facility in Indiana is home to 40 teenagers serving terms of up to 65 years for a range of serious crimes. This programme follows those spending their first night in the maximum-security prison and others preparing to move up to adult jail. They include Blake Layman, 17, sentenced to 55 years for murder, and Ireland MacKean, 16, who says he wants to stay out of trouble behind bars as he starts a 10-year term for robbery.
 Narrated by David Morrissey

